Duration of Androgen Suppression with Postoperative Radiotherapy (DADSPORT) for Nonmetastatic Prostate Cancer: A Collaborative Systematic Review and Meta-analysis of Aggregate Data

https://t.co/WWqOHsaC0P

This systematic review and meta-analysis by the DADSPORT Collaboration evaluated the impact of hormone therapy (HT) added to postoperative radiotherapy (RT) in nonmetastatic #ProstateCancer across five randomized controlled trials involving 4,411 participants. While HT did not significantly improve overall survival (OS) in the general population, it did show meaningful benefits in metastasis-free survival (MFS) and prostate cancer‚Äìspecific survival (PCSS), each with a 4% absolute improvement at 8 years. 

Notably, OS benefits may be limited to patients with higher pre-RT PSA levels or CAPRA-S scores. 

These findings support the use of adjuvant HT to improve cancer outcomes, particularly in higher-risk patients.

